css:
@-moz-document domain("electronjs.org") {
::selection {
    background: #3BD0D0;
    color: #505871;
}
body {
    background: #393E50;
    color: #73ABA9;
}
.lead,.blog-index-link{
    color: #73ABA9;
}
.subtron{
    background: #464C62;
    border: none;
}
code,.hljs{
    color: #BDBDBD;
    background: #464C62;
    box-shadow: 0 2px 1px #333;
}
.docs-version,pre .btn-clipboard{
    background: #505871;
    border: none;
}
h1 code, h2 code, h3 code, h4 code{
    background: #505871;
}
h1, h2, h3, h4, h5{
    color: #7eb8c3;
}
.docs-breadcrumbs a{
    color: #8E9CCE;
}
.site-header{
    color: #8E9CCE;
}
.site-header a.active, .site-header a:hover{
    color: #C19BF3;
}
.site-header-nav-item.active, .site-header-nav-item:active, .site-header-nav-item:hover{
    border-bottom-color: #7eb8c3;
}
h1 a, h2 a, h3 a, h4 a, h5 a, h6 a{
    color: #7eb8c3;
}
blockquote, .blockquote{
    color: #828282;
    border-color: #464C62;
}
.hljs-comment, .hljs-quote{
    color: #828282;
}
.docs .sub-section:not([data-lang='en-US']) .en-toggle h5{
    color: #73ABA9;
}
.hljs-keyword, .hljs-selector-tag, .hljs-subst{
    color: #C19BF3;
}
.hljs-string, .hljs-doctag{
    color: #89B789;
}
.footer{
    background: #464C62;
    border-color: #333;
}
}
